import React from 'react';

const About = () => {
  return (
    <div className="about">
      <h1>Dive deep into my Portfolio</h1>
      <p>Myat Theingi Nwe's (GIGI) Portfolio</p>
      <p>Location: Melbourne VIC 3000</p>
      <p>Contact: myattheingi.810@gmail.com</p>
      <p>+61 420 864 5</p>
    </div>
  );
};

export default About;
